import React, { useEffect, useState, useCallback, useMemo } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);
  const navigate = useNavigate();

  const userId = useMemo(() => sessionStorage.getItem("user_id"), []);

  const fetchCart = useCallback(async () => {
    if (!userId) {
      console.error("No user ID found in session.");
      return;
    }

    try {
      const response = await axios.post("http://localhost:8000/medical_store_app/cart/", { user_id: userId });
      const { cart_items, total_price } = response.data;

      setCartItems(cart_items || []);
      setTotalPrice(total_price || 0);

      // Backup in localStorage
      localStorage.setItem("cart", JSON.stringify(cart_items));
      localStorage.setItem("totalPrice", total_price);
    } catch (error) {
      console.error("Error fetching cart items:", error);

      // Fallback to localStorage
      const localCart = JSON.parse(localStorage.getItem("cart")) || [];
      const localTotalPrice = localStorage.getItem("totalPrice") || 0;

      setCartItems(localCart);
      setTotalPrice(localTotalPrice);
    }
  }, [userId]);

  useEffect(() => {
    fetchCart();
  }, [fetchCart]);

  const handleRemoveFromCart = async (cartId) => {
    try {
      await axios.post(`http://localhost:8000/medical_store_app/cart/remove/${cartId}/${userId}`);
      fetchCart();
    } catch (error) {
      console.error("Error removing cart item:", error);
    }
  };

  const handleProceedToCheckout = () => {
    if (cartItems.length === 0) {
      alert("Your cart is empty. Add items before proceeding.");
      return;
    }

    navigate("/checkout", {
      state: { cartItems, totalPrice, clearCart: () => setCartItems([]) },
    });
  };

  const handleContinueShopping = () => {
    navigate("/UserProductViews");
  };

  return (
    <div style={styles.container}>
      <button style={styles.continueShoppingButton} onClick={handleContinueShopping}>
        Continue Shopping
      </button>
      <h1 style={styles.heading}>Your Cart</h1>
      {cartItems.length > 0 ? (
        <table style={styles.table}>
          <thead>
            <tr>
              <th style={styles.tableHeader}>Medicine</th>
              <th style={styles.tableHeader}>Quantity</th>
              <th style={styles.tableHeader}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {cartItems.map((item, index) => (
              <tr key={index}>
                <td>{item.medicine.name}</td>
                <td>{item.quantity}</td>
                <td>
                  <button
                    onClick={() => handleRemoveFromCart(item.id)}
                    style={styles.button}
                  >
                    Remove
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p style={styles.message}>Your cart is empty.</p>
      )}
      <h3 style={styles.total}>Total: ₹{totalPrice}</h3>
      <div style={styles.bookContainer}>
        <button style={styles.paymentButton} onClick={handleProceedToCheckout}>
          Proceed to Checkout
        </button>
      </div>
    </div>
  );
};

const styles = {
  container: { padding: "70px", fontFamily: "Arial, sans-serif" },
  continueShoppingButton: { backgroundColor: "#4CAF50", color: "white", padding: "10px 20px", borderRadius: "5px" },
  heading: { textAlign: "center", fontSize: "2rem", marginBottom: "20px" },
  table: { width: "100%", borderCollapse: "collapse", marginBottom: "20px" },
  tableHeader: { backgroundColor: "#f4f4f4", padding: "10px", fontWeight: "bold" },
  button: { backgroundColor: "#ff4d4d", color: "white", padding: "5px 10px", borderRadius: "5px" },
  message: { textAlign: "center", fontSize: "1.2rem", margin: "20px 0" },
  total: { textAlign: "right", fontSize: "1.5rem", marginTop: "20px", fontWeight: "bold" },
  bookContainer: { display: "flex", justifyContent: "center", marginTop: "20px" },
  paymentButton: { backgroundColor: "#4CAF50", color: "white", padding: "10px 20px", borderRadius: "5px" },
};

export default Cart;
